def list_duplicates_and_uniques(mylist):
    uniques = []
    duplicates = []
    counts = {}
    for number in mylist:
        if number not in counts:
            counts[number] += 1
            if counts[number] == 2:
                duplicates.append(number)
        else:
            counts[number] = 1
            uniques.append(number)
    uniques.sort(reverse=True)
    return (uniques, duplicates)

